import React from 'react';
import './Header.css';
import './selfie.jpg';

function Name() {
    return (
        <div className="Name">
            <h1>Bradley Collins Maness</h1>
            <Portrait ></Portrait>
        </div>
    );
}

function Portrait() {
    return (
        <img src={"./selfie.jpg", alt="selfie"} />
    );
}

export default Name
